    public List<CuttingRecordedEventResponse> getCuttingRecordedEvents(TransactionReceipt transactionReceipt) {
        List<Contract.EventValuesWithLog> valueList = extractEventParametersWithLog(CUTTINGRECORDED_EVENT, transactionReceipt);
        ArrayList<CuttingRecordedEventResponse> responses = new ArrayList<CuttingRecordedEventResponse>(valueList.size());
        for (Contract.EventValuesWithLog eventValues : valueList) {
            CuttingRecordedEventResponse typedResponse = new CuttingRecordedEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse.sn = (byte[]) eventValues.getIndexedValues().get(0).getValue();
            typedResponse.qualified = (Boolean) eventValues.getNonIndexedValues().get(0).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

